        point *lpt;
        lpt = (point*)malloc(sizeof(point));
        lpt->left = NULL; lpt->right = NULL;
        lpt->data = cur;
        pt->left = lpt;
    }
    scanf("%c", &c);
    if (c=='('){
        pt->right = mktree();
        scanf("%c", &c);
